VALUES 
( 1, 'Porsche', '911', 2007, 188000, 'AWD', 'Automatic', 'Petrol', 620, 6, 3.6, 150000,
    'The Porsche 911 (pronounced Nine Eleven or in German: Neunelfer) is a two-door, 2+2 high performance rear-engined sports car made since 1963 by Porsche AG of Stuttgart, Germany. It has a rear-mounted flat-six engine and all round independent suspension.'),
( 2, 'Land Rover', 'Range Rover', 2016, 50000, '4WD', 'Automatic', 'Diesel', 430, 4, 2.0, 80000, 
    'The Land Rover Range Rover Evoque (commonly known as the Range Rover Evoque) is a series of subcompact luxury crossover SUVs produced by the British manufacturer Jaguar Land Rover, a subsidiary of Tata Motors, under their Land Rover marque.'),
( 3, 'Mercedes-Benz', 'SL 63 AMG', 2009, 101000, 'RWD', 'Automatic', 'Petrol', 630, 8, 6.2, 200000,
    'Mercedes-AMG SL63. The 2018 Mercedes-AMG SL63 Roadster comes equipped with a 5.5-liter twin-turbo V8 making 577 horsepower and 664 lb-ft of torque, mated to a 7-speed automatic transmission it provides class-leading performance figures. Ride and handling are superb as is the level of luxury on offer.'),
( 4, 'Chevrolet', 'Impala', 2002, 450000, 'FWD', 'Automatic', 'Petrol', 278, 6, 3.4, 50000,
    '2002 Chevrolet Impala. Chevrolet Impala is a modern, capable mid-size sedan, with a look and especially a name designed to push the nostalgia button for a certain generation.'),
( 5, 'GMC', '1000', 1964, 2000000, '2WD', 'Manual', 'Petrol', 400, 4, 3.8, 35000,
    'Clean, rare, and lovingly restored 1963 GMC Model 1000 1/2 Ton Short Bed Fleetside Pickup, original 305 cubic inch V6, factory original 4-on-the-floor 4 speed manual transmission with a granny gear, inspected, and runs and drives great! 2 door short bed with a cloth bench seat, manual windows and door locks, polished chrome baby moon wheels and hubcaps, originally built in Oakland, CA! Painstakingly reconditioned to almost new, with new period-correct upholstery, rubber floor, inner doors, all chrome appears perfect, truck bed with new polished oak, and chrome and stainless hardware, not a detail neglected! Super clean and fun, turquoise and white head-turner, odometer shows 68,469 miles, great shape in and out!'),
( 6, 'Volvo', '440/460', 1989, 4000000, '2WD', 'Manual', 'Petrol', 350, 4, 2.0, 60000,
    'The Volvo 440 and 460 are versions of a small family car produced by the Swedish manufacturer Volvo between 1987 and 1996. The 440 was introduced in 1987, whilst the 460 followed in 1989. They were built at the NedCar factory in Born, the Netherlands. The 440 was a five-door front wheel drive hatchback and the 460 a saloon.'),
( 7, 'BMW', '528i', 2016, 20000, 'RWD', 'Automatic', 'Petrol', 450, 4, 2.0, 30000,
    'Super clean 2016 BMW 528i sedan, with Driver Assist pkg, navigation, power heated seats, rear camera, automatic transmission with paddle shifters, power windows and locks, power glass moonroof, and guaranteed bumper to bumper! 2016 BMW 528i, 4 door sedan, 2.0 liter turbocharged 4 cylinder engine with 31 mpg, shiftable StepTronic automatic transmission with overdrive and paddle shifters, navigation, keyless ignition, rear camera, front and rear parking sensors, power windows and door locks, dual power heated leatherette seats, power glass moonroof, Bluetooth stereo and phone, fold down back seats, alloy wheels with run-flat tires, tilt wheel, cruise control, cd player with mp3 aux input jack, steering wheel buttons for the stereo and phone, ABS brakes, dual front airbags, front side airbags, and more! Beautiful and sleek Space Gray metallic exterior with immaculate black interior, dark burl wood trim, flawless inside and out!'),
( 8, 'BMW', 'M Roadster', 1998, 240000, 'RWD', 'Manual', 'Petrol', 450, 6, 3.2, 66000,
    'Clean classic bodystyle 1998 BMW Z3 M Roadster, limited production enthusiast sports car with Premium package, power top, power everything, power heated leather seats, and guaranteed! Always a car show favorite, this 1998 BMW Z3 M Roadster has a power convertible soft top with brand new back window, 3.2 liter 6 cylinder with 240 hp, 5 speed manual transmission, power windows and door locks, dual power heated leather M-Sport seats, huge M-Sport alloy wheels, cruise control, AM-FM-CD, ABS brakes, factory roll bars, dual front airbags, and more! Beautiful and rare Imola Red paint with immaculate black leather interior, immaculate inside and out! Clean car, non-smoker, just serviced, meticulously maintained by elderly owner, only 24k original garage princess miles, and guaranteed!'),
( 9, 'FORD', 'F-150 XLT SuperCrew', 2018, 15000, 'RWD', 'Automatic', 'Petrol', 650, 6, 5.0, 223000,
    '2018 Ford F150 XLT SuperCrew Cab 4x4, 5.0 liter V8 with 395 hp, 4 door crew cab that seats 6, power windows and locks, rear camera, a/c, 6 speed automatic transmission with overdrive, in-dash CD with mp3 aux input jack, ABS anti-lock brakes, dual front airbags, side airbags, dual chrome bumpers, tow pkg, alloy wheels, and more! This truck is excellent inside and out! Perfect and popular bright white paint with immaculate gray cloth interior, excellent condition, and just serviced! One owner California fleet lease truck, only 25K miles (just 12k per year!), clean history certified, just arrived, immaculate inside and out, non-smoker, guaranteed bumper to bumper, and still under factory warranty! Extra popular combination with V8, 4x4, roomy cab, and tow package!'),
( 10, 'FORD', 'Thunderbird', 1955, 3500000, 'RWD', 'Automatic', 'Petrol', 400, 4, 4.9, 40000,
    'Clean, rare, and mostly restored 1955 Ford Thunderbird Convertible, original 292 cubic inch/4.9 liter V8, factory Ford-O-Matic automatic transmission, inspected, runs and drives great, and guaranteed! 1955 original muscle car T-Bird, 2 door convertible with removable hardtop, manual windows and door locks, original style reupholstered two-tone red and white vinyl front bench seat, original hubcaps, original fender skirts, and more! Super clean and fun, red and white head-turner, odometer shows 147 miles (but it was likely reset to zero after rebuildï¿½they used to do that back when it was legal), great shape in and out! It could be your concourse project or a great fun driver!'),
( 11, 'HONDA', 'Civic', 2015, 1000000, 'RWD', 'Automatic', 'Petrol', 450, 4, 2.0, 54000,
    'Honda (American Honda Motor Co.) is recalling certain 2017-2018 Honda Civic Hatchback and Civic Type R vehicles. The owners guide in these vehicles may not have been included or if included, the owner''s guide may not have been properly provided required information. As such, these vehicles fail to comply with the requirements of Federal Motor Vehicle Safety Standard (FMVSS) number 225, "Child Restraint Anchorage Systems.'),
( 12, 'JEEP', 'Grand Cherokee', 2012, 150000, '4WD', 'Automatic', 'Petrol', 620, 6, 3.6, 45600, 
    '3-point rear center seat beltChild seat upper tether anchors Dual note horns Enhanced accident response system Front & rear side curtain air bags Hill start assist (HSA)LATCH-ready hild seat anchor system Multi-stage front air bags Rain brake support Ready alert brakingRear door child safety locks Trailer sway damping'),
( 13, 'Aston Martin', 'Rapide', 2012, 23000, 'RWD', 'Automatic', 'Petrol', 560, 4, 6.0, 80000,
    'Driver/front passenger dual stage airbags Driver/front passenger side impact airbags Electronic brakeforce distribution (EBD) Front/rear crumple zones Front/rear curtain airbagsFront/rear parking sensors Front/rear seatbelt pretensioners Passenger air bag sensor Positive torque control (PTC) Rear seat ISOFIX child seat attachment points Side impact door beams Tire pressure monitor system'),
( 14, 'Toyota', 'Camry', 2012, 20000, 'AWD', 'Manual', 'Petrol', 450, 6, 3.2, 35000,
    'Toyota Camry is a top-ranked midsize car. It has pleasing driving dynamics, good fuel efficiency, and loads of technology. It also boasts impressive safety scores and a good predicted reliability rating.'),
( 15, 'Skoda', 'Octavia', 2011, 177000, 'AWD', 'Manual', 'Propane', 350, 4, 2.0, 80000,
    'It is safe to say that the Skoda Octavia is one of the best family cars on the market, in terms of value for money, practicality, reliability, and drive quality'),
( 16, 'Renault', 'Logan', 2008, 500000, 'AWD', 'Manual', 'Gas', 420, 4, 2.0, 86000,
    'The Dacia Logan is a subcompact car produced jointly by the French manufacturer Renault and its Romanian subsidiary Dacia since 2004. It is currently in its second generation and it has been produced as a sedan, station wagon, notchback or pick-up. It has been manufactured at Dacia''s automobile plant in Mioveni, Romania, and at Renault''s (or its partners'') plants in Morocco, Brazil, Argentina, Turkey, Russia, Colombia, Iran and India. The pick-up was also produced at Nissan''s plant in Rosslyn, South Africa.'),
( 17, 'Mercedez-Benz', 'W220', 2001, 500000, 'AWD', 'Automatic', 'Gas', 520, 4, 3.2, 350000,
    'The Mercedes-Benz W220 was a series of flagship sedans which constituted the Mercedes-Benz S-Class during the early to mid-2000s. Development for the W220 S-Class started in 1992, with the final design, helmed by Steve Mattin being approved in June 1995 at 38 months ahead of production start and completed design freeze in March 1996, at 29 months before the start of production in August 1998.'),
( 18, 'Peugeot', '207', 2007, 400000, 'AWD', 'Manual', 'Gas', 320, 4, 1.4, 54000,
    'The Peugeot 207 is a supermini manufactured and marketed by French automaker Peugeot from 2006 to 2014. It debuted in January 2006, and launched in April 2006. The 207 replaced the 206 in April 2006 and was superseded by the Peugeot 208 in April 2012.'),
( 19, 'Skoda', 'Superb', 2012, 150000, 'AWD', 'Automatic', 'Petrol', 400, 4, 1.8, 70060,
    'The Skoda Superb is a large family/compact executive car that has been produced by the Czech car manufacturer Skoda Auto since 2001.'),
( 20, 'Daewoo', 'Lanos', 2008, 200000, 'AWD', 'Manual', 'Gas', 350, 4, 1.4, 45000,
    'The Daewoo Lanos is a subcompact car produced by the South Korean manufacturer Daewoo from 1997 to 2002, and thereafter produced under license agreements in various countries worldwide. It has also been marketed as the Daewoo Sens, ZAZ Sens and ZAZ Lanos in Ukraine, Doninvest Assol and ZAZ Chance in Russia, FSO Lanos in Poland, or Chevrolet Lanos in Ukraine, Russia, and Egypt.'),
( 21, 'Lexus', 'RX350', 2013, 140000, 'AWD', 'Automatic', 'Petrol', 500, 6, 3.5, 55000,
    'The Lexus RX  is a mid-size luxury crossover SUV sold since 1998 by Lexus, a luxury division of Toyota. Originally released in its home market of Japan in late 1997 as the Toyota Harrier, export sales began in March 1998 as the Lexus RX.Four generations of the Lexus RX have been produced to date, the first being compact in size, and the latter three classified as mid-size. Both front- and four-wheel drive configurations have been used on the RX series, and several gasoline powertrain options, including V6 engines and hybrid systems, have been offered. In the Lexus model lineup, the RX sits below the larger GX and LX (Known as the Toyota Land Cruiser Prado and the Toyota Land Cruiser body-on-frame SUVs outside North America, and above the smaller NX crossover with a lower displacement inline-4 engine. '),
( 22, 'Chery', 'Amulet', 2007, 300000, 'AWD', 'Manual', 'Gas', 250, 4, 1.4, 76000,
    'The Chery A15 also known as Cowin, Flagcloud or Amulet, is a subcompact car produced by the Chinese manufacturer Chery from 2003 to 2010. A facelifted variant was called the Cowin 2 and was sold from 2010 to 2016.'),
( 23, 'Mazda', '6', 2011, 110000, 'RWD', 'Manual', 'Petrol', 280, 4, 2.0, 60000,
    'The Mazda 6 or Mazda6 (known as the Mazda Atenza in Japan, China, Malaysia and Singapore, derived from the Italian attenzione) is a mid-size car produced by Mazda since 2002. It replaced the long-produced Capella/626 in 2002. The Mazda6 sold more than one-million units faster than all previous Mazdas.'),
( 24, 'Alfa Romeo', '159', 2012, 150000, 'RWD', 'Manual', 'Gas', 340, 4, 2.2, 86500,
    'The Alfa Romeo 159 (Type 939) is a compact executive car produced by the Italian manufacturer Alfa Romeo between 2005 and 2011. It was introduced at the 2005 Geneva Motor Show, as a replacement for the 156. The 159 used the GM/Fiat Premium platform, shared with the Alfa Romeo Brera and Spider production cars, and with the Kamal and Visconti concept cars.The 159 placed third in the 2006 European Car of the Year awards. Production of the 159 ended in October 2011, and around 240,000 cars were built.'),
( 25, 'Nissan', 'Micra', 2014, 130000, 'RWD', 'Manual', 'Petrol', 240, 4, 1.2, 35000,
    'Insurance Group 7, 1 Previous Owner, Audible driver''s seatbelt reminder, Bluetooth phone integration system, Cruise control + speed limiter, Digital clock, Door ajar warning lamp, Electric speed sensitive power steering, Interior fuel flap release, On board computer, Service interval indicator, Trip computer, 4 speakers, Stereo radio/CD player and MP3 facility, Anti dazzle rear view mirror, Automatic'),
( 26, 'Bugatti', 'Veyron', 2009, 160000, 'AWD', 'Manual', 'Petrol', 800, 6, 8.0, 1000000,
    '2 Previous Owners, Polished Aluminium Wheels, Comfort Seats, Hard Top Removable Roof, Soft-Top Travel Cover, Reversing Camera, CD Player'),
( 27, 'Audi', 'A5', 2012, 180000, 'AWD', 'Manual', 'Petrol', 400, 4, 2.0, 56000,
    'Excellent condition need a family car now, MOT until Jan 2020 full service history car was brought from audi approved in 2018 5 owners maintained very well and runs like a dream. Hasn''t given me any problems, very smooth. Don''t really want to sell but due to circumstances need a 5 door. Drivers side of the door has a key stretch other then that in good shape. Inspections Welcome. Car is in use so mileage will go up.'),
( 28, 'BMW', '1 Series', 2017, 130000, 'AWD', 'Manual', 'Petrol', 450, 4, 1.5, 54000,
    'For sale is this lovely 2017 BMW 118i Sport Hatchback 1.5 3DR MANUAL PETROL IN WHITE.Very low mileage only 13,000 on the clock, 6 Speed Manual Gearbox Car comes with Part Service History at BMW Dealership, Independent Garage.Recent Service done on 6 09 2019 (Independent Garage) new Oil change,Oil filter,pollen filter,air filter,Diff seal caps with oil change, Both Rear Shock absorbers new fitted costing over ?300.This car looks fabulous and drives excellent as a BMW stands for and it has the smooth grip,power and feel to its performance the best in its 1 series In Lovely White colour The condition on the inside and outside is clean and body has been polished recently'),
( 29, 'Mercedes-benz', 'C', 2004, 150000, 'AWD', 'Manual', 'Diesel', 300, 4, 2.1, 60000,
    'Selling this great Mercedes for someone than like power and amazing brand!!New Brakes, Good Tyres, Only 3 Owners, Mechanism In day whit review every 6 months.Good bodywork and engine, comfortable, 5 seats 4 doors and several large trunk compartments and very good and fast on the road'),
( 30, 'Ford', 'Focus', 2012, 300000, 'AWD', 'Manual', 'Diesel', 350, 4, 1.6, 80000,
    'Insurance Group 14, 1 Previous Owner, Ford Focus 1.6 Ti-VCT 125 Titanium AUTOMATIC Silver, 5-door Estate,First class condition, Petrol 54,000 Miles, 12 month MOT ?5,650 07761 327668');

